import React from "react";

const Cards = ({ item }) => {
  const { id, name, genus, family } = item;
  return (
    <div className="cards">
      <div className="details">
        <p>{id}</p>
        <p>{name}</p>
        <p>{genus}</p>
        <p>{family}</p>
        <button>Adicionar ao Carrinho</button>
      </div>
    </div>
  );
};

export default Cards;
